import React from 'react';
import './navbar.css'
import logo from './LogoSample_ByTailorBrands(11)(1).png'
import { Link } from 'react-router-dom';

function Navbar (props){

    return(
        <div>
        <Link to="/" className="logoHome"> <img src={logo} className="logo"alt="logo"/></Link>
        <Link className="about" onClick={props.onClick} >SOBRE MI</Link>
        <Link className="proyect" onClick={props.onClick} >PROYECTOS</Link>
        <Link className="contact" onClick={props.onClick} >CONTACTO</Link>
        {/*<div className="logoContact" onClick={props.onClick} ><span>CONTACTO</span></div> */} 
        </div>
    )

}

export default Navbar
